    true,nt"url": null,nt"notes": "<p>The Centers for Medicare and Medicaid
    Services CMS is dedicated to continually strengthening and improving the Medicare
    program, which provides vital services to millions of Americans. CMS uses data from
    the Comprehensive Error Rate Testing CERT program and other sources of information
    to address improper payments in the Medicare FFS program through various corrective
    actions.  Each year, the Department of Health and Human Services Agency Financial
    Report outlines actions the agency will implement to prevent and reduce improper
    payments.  CMS and the Medicare Administrative Contractors MACs aim to help improve
    provider compliance with Medicare FFS policies and requirements.  Provider compliance
    is fundamental to reducing improper payment rates.<br />nThe maps displays the 2014
    and 2015 improper payment rate information for the Medicare FFS program for A-B,
    Home Health-Hospice, and Durable Medical Equipment DME MAC jurisdictions. The jurisdictions
    listed  are based on the MAC jurisdictions assigned during the 2014 and 2015 Medicare
    FFS improper payment report periods i.e., July 1, 2012 - June 30, 2013, and July
    1, 2013 - June 30, 2014, respectively.  An Error Rate Contribution Score was assigned
    to each jurisdiction to reflect two key variables, the jurisdictions improper payment
    rate and share of national improper payments.</p>n",nt"license_title": "Other
